private boolean closeTag() {
    int size = tagStack.size();
    if (size == 1) {
        tagStack.pop();
        yybegin(IN_DOCSTRING_OWNER);    // done with pyxl code.
        return true;
    } else if (size == 0) {
        return false;   // error
    } else {
        tagStack.pop();
        yybegin(IN_PYXL_BLOCK); // back to pyxl-block state
        return true;
    }
}

